import React from "react";
import ReactDOM from 'react-dom';
import Cards from "./Cards";
import "./index.css"
import Sdata from "./Sdata";


ReactDOM.render(
    <>
      <h1 className="heading_style">List of top 5 Netflix series in 2023</h1>

    <Cards 
        imgsrc= {Sdata[0].imgsrc}
        title= {Sdata[0].title}
        sname= {Sdata[0].sname}
        link= {Sdata[0].link}
    />
    <Cards 
     sname={Sdata[1].imgsrc}
     imgsrc={Sdata[1].title}
     title={Sdata[1].sname}
     link={Sdata[1].link}
 />

    <Cards 
   sname={Sdata[2].imgsrc}
   imgsrc={Sdata[2].title}
   title={Sdata[2].sname}
   links={Sdata[2].links}
/>

    <Cards 
     sname={Sdata[3].imgsrc}
     imgsrc={Sdata[3].title}
     title={Sdata[3].sname}
     links={Sdata[3].links}
     />

    <Cards 
     sname={Sdata[4].imgsrc}
     imgsrc={Sdata[4].title}
     title={Sdata[4].sname}
     links={Sdata[4].links}
 />


    </>,
    document.getElementById("root")
);
